import React, { useState, useEffect } from 'react';

import {
  Container,
  Grid,
  Paper,
  Typography,
  List,
  ListItem,
  ListItemText,
  makeStyles,
} from '@material-ui/core';
import {
  Warning as WarningIcon,
  Category as CategoryIcon,
  LocalOffer as PriceIcon,
} from '@material-ui/icons';
import api from '../services/api';

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: theme.spacing(4),
  },
  paper: {
    padding: theme.spacing(3),
    display: 'flex',
    flexDirection: 'column',
    height: '100%',
  },
  title: {
    marginBottom: theme.spacing(2),
    display: 'flex',
    alignItems: 'center',
  },
  icon: {
    marginRight: theme.spacing(1),
    color: theme.palette.primary.main,
  },
  warningIcon: {
    color: theme.palette.error.main,
    marginRight: theme.spacing(1),
  },
  listItem: {
    borderBottom: `1px solid ${theme.palette.divider}`,
  },
  stat: {
    textAlign: 'center',
    marginBottom: theme.spacing(2),
  },
  statValue: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: theme.palette.primary.main,
  },
}));

function Dashboard() {
  const classes = useStyles();
  const [lowStockProducts, setLowStockProducts] = useState([]);
  const [productStats, setProductStats] = useState({
    totalProducts: 0,
    totalCategories: 0,
    averagePrice: 0,
  });

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      // Load low stock products
      const lowStockResponse = await api.getLowStockProducts(10);
      setLowStockProducts(lowStockResponse.data);

      // Load all products for statistics
      const productsResponse = await api.getAllProducts();
      const products = productsResponse.data;

      // Calculate statistics
      const categories = new Set(products.map(p => p.category));
      const totalPrice = products.reduce((sum, p) => sum + p.price, 0);

      setProductStats({
        totalProducts: products.length,
        totalCategories: categories.size,
        averagePrice: products.length ? (totalPrice / products.length).toFixed(2) : 0,
      });
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    }
  };

  return (
    <Container className={classes.container}>
      <Grid container spacing={4}>
        {/* Statistics Cards */}
        <Grid item xs={12} md={4}>
          <Paper className={classes.paper}>
            <div className={classes.stat}>
              <Typography variant="h6">Total Products</Typography>
              <Typography className={classes.statValue}>
                {productStats.totalProducts}
              </Typography>
            </div>
          </Paper>
        </Grid>
        <Grid item xs={12} md={4}>
          <Paper className={classes.paper}>
            <div className={classes.stat}>
              <Typography variant="h6">Categories</Typography>
              <Typography className={classes.statValue}>
                {productStats.totalCategories}
              </Typography>
            </div>
          </Paper>
        </Grid>
        <Grid item xs={12} md={4}>
          <Paper className={classes.paper}>
            <div className={classes.stat}>
              <Typography variant="h6">Average Price</Typography>
              <Typography className={classes.statValue}>
                ${productStats.averagePrice}
              </Typography>
            </div>
          </Paper>
        </Grid>

        {/* Low Stock Products */}
        <Grid item xs={12}>
          <Paper className={classes.paper}>
            <Typography variant="h6" className={classes.title}>
              <WarningIcon className={classes.warningIcon} />
              Low Stock Products
            </Typography>
            <List>
              {lowStockProducts.map((product) => (
                <ListItem key={product.id} className={classes.listItem}>
                  <ListItemText
                    primary={product.name}
                    secondary={`Quantity: ${product.quantity} | Category: ${product.category}`}
                  />
                </ListItem>
              ))}
              {lowStockProducts.length === 0 && (
                <ListItem>
                  <ListItemText primary="No low stock products" />
                </ListItem>
              )}
            </List>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Dashboard;
